jQuery( document ).ready(function() {
	//Formulari JPO Videojocs formID 67
	let checkboxesJPO = jQuery('#gform_67 .custom_estudis .ginput_container_checkbox input[type="checkbox"');
	let checkboxesArrayJPO = [].slice.call(checkboxesJPO);
	let valuesJPO = []; 
	
	checkboxesJPO.on('change', () => {
		valuesJPO = checkboxesArrayJPO
		.filter((checkboxJPO) => checkboxJPO.checked)
		.map((checkboxJPO) => checkboxJPO.value);
		let estudisJPO = valuesJPO;
		
		let replace = (arr, oldVal, newVal) => (arr[arr.indexOf(oldVal)] = newVal, arr);
		(replace(estudisJPO, "CF_ASIXCB", "JPO_ASIXCB_MAI25"));
		(replace(estudisJPO, "GU_CIBER", "JPO_CIBER_MAI25"));
		
		let myEstudisJPO = estudisJPO.join(', ');
		
		console.log("Activitats JPO: "+myEstudisJPO);
		jQuery('.gform_hidden input[name="input_81"]').val(myEstudisJPO);
	});

});


