jQuery( document ).ready(function() {
//jQuery(document).bind('gform_post_render', function(){
	
	jQuery('.custom_campanya select').on('change', function(){
		let campaign_year = jQuery(this).children("option:selected").val();
		
		if (campaign_year == '3r ESO'){
			campaign_year = '28-29';
		}
		else if (campaign_year == '4t ESO') {
				 campaign_year = '27-28';
				 }
		else if (campaign_year == '1r BATX' || campaign_year == '1r CFGM' || campaign_year == '1r CFGS') {
				 campaign_year = '26-27';
		}
		else if (campaign_year == '2n BATX' || campaign_year == 'Universitaris' || campaign_year == 'Universitarios' || campaign_year == 'Conservatori' || campaign_year == '2n CFGM' || campaign_year == '2n CFGS' || campaign_year == 'Altres' || campaign_year == 'Otros') {
				 campaign_year = '25-26';
		}
		
		console.log(campaign_year);
		jQuery('.gform_hidden input[name="input_70"]').val(campaign_year);
	});

});



